INSERT INTO `blog` VALUES ('02992040-b48c-11ea-a9c3-fd072abe39e3','同城交友','张友谅','交友','hello everyone',NULL,0,0,0,'2020-06-22 13:26:42'),('4c941e08-b755-11ea-a9c3-fd072abe39e3','RecyclerView','小怪兽','技术','安卓RecyclerView那些事-（二）实现一个下拉刷新RecyclerView','通过LinearLayoutManager获得一下几个参数：item的总个数，当前可见的最后一个item在所有item中的位置，当前可见的最后一个item的bottom，RecyclerView的bottom。\r\n我们为RecyclerView添加滑动监听函数RecyclerView.addOnScrollListener(mOnScrollListener),在滑动监听函数中我们判断当前可见的最后一个item是不是RecyclerView中所有item的最后一个，并且当前可见的最后一个item的bottom是不是等于RecyclerView的bottom。\r\n代码如下：\r\n\r\n作者：小怪兽LY\r\n链接：https://www.jianshu.com/p/90e9865181ec\r\n来源：简书\r\n著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。',0,0,0,'2020-06-26 02:32:37'),('7bb20d9b-b755-11ea-a9c3-fd072abe39e3','黑科技','Android','科技','Android最强保活黑科技的最强技术实现','今天来跟大家分享TIM最强保活思路的几种实现方法。这篇文章我将通过ioctl跟binder驱动交互，实现以最快的方式唤醒新的保活服务，最大程度防止保活失败。同时，我也将跟您分享，我是怎么做到在不甚了解binder的情况下，快速实现ioctl binder这种高级操作。\r\n\r\n作者：Alvin老师\r\n链接：https://www.jianshu.com/p/f75d4fa71686\r\n来源：简书\r\n著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。',0,0,0,'2020-06-26 02:33:56'),('84a53089-b5fd-11ea-a9c3-fd072abe39e3','test1','test1','test1','test1','test1',0,0,0,'2020-06-24 09:31:44'),('84a6f54a-b5fd-11ea-a9c3-fd072abe39e3','五四运动','胡适','爱国','五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动','五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动五四运动',0,0,0,'2020-06-24 09:31:44'),('84a8a9d1-b5fd-11ea-a9c3-fd072abe39e3','test2','test2','test2','test2','test2',0,0,0,'2020-06-24 09:31:44'),('a4e34afe-b755-11ea-a9c3-fd072abe39e3','优秀框架整理','GitHub','科技','所有的UI框架 要用起来才能算好的UI框架','好好看 好好学\r\n可以多多尝试在项目中突破引用尝试\r\n一些项目没有提供gradle依赖的引入，可以通过导入mudule的方式使用\r\n\r\n此文章保持更新',0,0,0,'2020-06-26 02:35:05'),('bcadfd1f-b75b-11ea-a9c3-fd072abe39e3','标题0','作者0','标签0','概述这个方法与上面的方法看起来似乎一模一样，只是一个是setOnScrollListener，一个是','内容0',0,0,0,'2020-06-26 03:18:42'),('bcae0efd-b75b-11ea-a9c3-fd072abe39e3','标题1','作者1','标签1','概述这个方法与上面的方法看起来似乎一模一样，只是一个是setOnScrollListener，一个是','内容1',0,0,0,'2020-06-26 03:18:42'),('bcae2f80-b75b-11ea-a9c3-fd072abe39e3','标题2','作者2','标签2','概述